import React from 'react';
import img1 from '../images/img1';
import img2 from '../images/img2';
import img3 from '../images/img3';

class Carousel extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			items: [
				{
					id:0,
					title:'Proj1',
					subtitle : 'sub1',
					imgSrc: img1,
					link : 'link1',
					selected : false
				},
				{
					id:1,
					title:'Proj2',
					subtitle : 'sub2',
					imgSrc: img2,
					link : 'link2',
					selected : false
				},
				{
					id:2,
					title:'Proj3',
					subtitle : 'sub3',
					imgSrc: img3,
					link : 'link3',
					selected : false
				},
			]
			
		}
	}
	
	render() {
		return(
			<p> Carousel works!</p>
		);
	}
}
	

export default Carousel;
